@implementation HMDescConfig

// 内置数据版本号，默认从1.0开始，如果内置数据有更新则更改此版本号
+(NSString *)descInAppVersion
{
    return @"v4.2.0.300";
}

// 数据库中数据的版本号
+(NSString *)descInDbVersion
{
    NSString * sql = [NSString stringWithFormat:@"select dbVersion from dbVersion where versionId = 2"];
    
    FMResultSet * rs = [[HMDatabaseManager shareDatabase]executeQuery:sql];
    if ([rs next]) {
        
        NSString *version = [rs stringForColumn:@"dbVersion"];
        
        [rs close];
        
        return version;
    }
    [rs close];
    
    return nil;
}


+(BOOL)isBuiltInDataVersionChanged
{
    LogFuncName();
    
    NSString *dataInAppVersion = [[self class]descInAppVersion];
    NSString *dataInDbVersion = [[self class]descInDbVersion];
    
    BOOL changed = ![dataInAppVersion isEqualToString:dataInDbVersion];
    
    DLog(@"dataInAppVersion = %@ dataInDbVersion = %@ %@",dataInAppVersion,dataInDbVersion,changed ? @"版本号发生变化":@"版本号未发生变化");
    return changed;
}

+ (void)getDeviceInfoFromServer:(commonBlock)completion
{
    LogFuncName();
    
    if (!isNetworkAvailable()) {
        DLog(@"无网络，不再请求设备描述信息");
        return;
    }
    
    // 查询语句需要放在主线程执行，否则可能导致FMDatabase崩溃
    // BUG IN CLIENT OF sqlite3.dylib: illegal multi-threaded access to database connection
    
    dispatch_queue_t queue = dispatch_queue_create("com.orvibo.getDeviceInfoFromServer", NULL);
    
    int lastUpdateTime = [self getLastUpdateTime];

    dispatch_async(queue, ^{
        NSError *error = nil;
        
        NSString *descSource = [HMStorage shareInstance].descSource;
        NSString *urlString = [NSString stringWithFormat:kGet_DeviceDesc_URL,lastUpdateTime,descSource];
        urlString = dynamicDomainURL(urlString);
        DLog(@"获取设备描述信息URL:%@",urlString);
        urlString = [urlString stringByAddingPercentEncodingWithAllowedCharacters:[NSCharacterSet URLQueryAllowedCharacterSet]];
        NSData *data = [NSData dataWithContentsOfURL:[NSURL URLWithString:urlString]];
        if (data) {
            NSDictionary *deviceInfoDic = [NSJSONSerialization JSONObjectWithData:data options:NSJSONReadingMutableContainers error:&error];
            
            if (!error && deviceInfoDic) {
                NSNumber *errorCode = deviceInfoDic[@"errorCode"];
                
                if (errorCode.intValue == KReturnValueSuccess) {
                    
                    DLog(@"http获取设备描述信息成功:%@",deviceInfoDic);
                    
                    NSMutableArray *objectsArray = [NSMutableArray array];
                    
                    // 设备信息表
                    NSArray *deviceDescArr = [deviceInfoDic objectForKey:@"deviceDescList"];
                    if ([deviceDescArr isKindOfClass:[NSArray class]]) {
                        for (NSDictionary *dic in deviceDescArr) {
                            HMDeviceDesc *deviceDescObj = [HMDeviceDesc objectFromDictionary:dic];
                            if (deviceDescObj) {
                                [objectsArray  addObject:deviceDescObj];
                            }
                        }
                    }
                    
                    // 设备语言包表
                    NSArray *deviceLanguageArr = [deviceInfoDic objectForKey:@"deviceLanguageList"];
                    if ([deviceLanguageArr isKindOfClass:[NSArray class]]) {
                        for (NSDictionary *dic in deviceLanguageArr) {
                            HMDeviceLanguage *dlObj = [HMDeviceLanguage objectFromDictionary:dic];
                            if (dlObj) {
                                [objectsArray  addObject:dlObj];
                            }
                        }
                    }
                    
                    // 二维码对照表
                    NSArray *qrCodeArr = [deviceInfoDic objectForKey:@"qrCodeList"];
                    if ([qrCodeArr isKindOfClass:[NSArray class]]) {
                        for (NSDictionary *dic in qrCodeArr) {
                            HMQrCodeModel *qrObj = [HMQrCodeModel objectFromDictionary:dic];
                            if (qrObj) {
                                [objectsArray  addObject:qrObj];
                            }
                        }
                    }
                    
                    [[HMDatabaseManager shareDatabase]inTransaction:^(FMDatabase *db, BOOL *rollback) {
                        
                        DLog(@"-----开始把设备描述表%ld条信息写入数据库",(long)objectsArray.count);
                        
                        [objectsArray setValue:db forKey:@"insertWithDb"];
                        
                        DLog(@"-----设备描述表信息写入数据库完成");
                        
                        [self finishWithStatus:KReturnValueSuccess completion:completion];
                    }];
                    
                    DLog(@"设备描述信息的最大更新时间：%ld",[deviceInfoDic[@"lastUpdateTime"] integerValue]);
                }else{
                    DLog(@"获取设备描述信息错误码：%@%@",errorCode,errorCode.intValue == 51 ? @" 设备描述信息无更新":@"");
                    [self finishWithStatus:errorCode.intValue completion:completion];
                }
            }else{
                [self finishWithStatus:KReturnValueFail completion:completion];
            }
        }else{
            [self finishWithStatus:KReturnValueFail completion:completion];
        }
    });
        
}

+(void)finishWithStatus:(KReturnValue)value completion:(commonBlock)completion
{
    if (completion) {
        dispatch_async(dispatch_get_main_queue(), ^{
            completion(value);
        });
        
    }
}
// 设备描述相关的三张表的最大时间
+ (int)getLastUpdateTime
{
    int lastUpdatime = 0;
    
    NSString *sql = [NSString stringWithFormat:@"select max(updateTime) as MaxUpdateTime from (select max(updateTime) as updateTime from deviceDesc UNION select max(updateTime) as updateTime from deviceLanguage UNION select max(updateTime) as updateTime from qrCode)"];
    FMResultSet *set = [[HMDatabaseManager shareDatabase] executeQuery:sql];
    if ([set next]) {
        NSString *dateStr = [set stringForColumn:@"MaxUpdateTime"];
        if (dateStr
            && (![dateStr isEqualToString:@""])
            && (![dateStr isEqualToString:@"null"])) {
            
            lastUpdatime = secondWithString(dateStr);
            DLog(@"设备描述信息最大更新时间：%@",dateStr);
        }
    }
    [set close];
    
    DLog(@"设备描述信息最大更新时间：%d",lastUpdatime);
    return lastUpdatime;
}



+(NSArray *)localConfigSQL
{
    NSString *localDescSQL = [[[self class]createTableSQL]stringByAppendingString:[[self class]tableContentSQL]];
    NSArray *SQLs = [localDescSQL componentsSeparatedByString:@";"];
    return SQLs;
}


+(NSString *)createTableSQL
{
    return[NSString stringWithFormat:@""
    
    "DELETE FROM deviceDesc;"
    "DELETE FROM qrCode;"
    "DELETE FROM deviceLanguage;"
    "INSERT INTO dbVersion (versionId,dbVersion) values (2,'%@');"//内置数据的版本号id为2
           
    ,[[self class]descInAppVersion]];
}

